import React from "react";
import styled from "styled-components";


class Group139122 extends React.Component {
  render() {
    return (
      <Group13912>
        <Group src="/img/group-69@2x.svg" />
      </Group13912>
    );
  }
}

const Group13912 = styled.div`
  height: 16px;
  margin-left: 8px;
  margin-top: 3px;
  display: flex;
  padding: 2.9px 4px;
  align-items: flex-start;
  min-width: 16px;
  background-color: var(--westar);
  border-radius: 8px;
  transform: rotate(90deg);
`;

const Group = styled.img`
  width: 8px;
  height: 10px;
  transform: rotate(-90deg);
`;

export default Group139122;
